import React from 'react';
import Pro from './proe.jpg';
import './style.css';

export default function Hero() {
    return (
        <section id="home" className="hero">
            <div className="left">
                <h1>Hello<span>.</span></h1>
                <h4>I'm Sakshi Kadu</h4>
                <h3>Web Developer</h3>

                <p>
                    I'm a passionate Web Developer focused on building responsive and
                    interactive websites. I love turning ideas into real-world web
                    experiences using React, JavaScript, and creative design.
                </p>
            </div>
            <div className="right">
                <img src={Profile} alt="profile" />
            </div>
        </section>
    );
}
